import React,{useState} from "react";
//import TextField from '@material-ui/core/TextField';
import UpdateInput from './UpdateInput';

const NewJournalForm = ({ saveTodo }) => {
  const { value, reset, onChange } = UpdateInput();
  return (
    <form
      onSubmit={event => {
        event.preventDefault();

        saveTodo(value);
        reset();
      }}>
      <div className="new-journal-wrapper">
        <h2>New Journal</h2>

        <div className="new-journal-form">
          <div className="form-group">
            <label>Title</label>
            <br />
            <input onChange={onChange}
              defaultValue={value}
              className="title-input-field"
              placeholder="Journal Title"
            ></input>
          </div>
          <div className="form-group">
            <label>Description</label>
            <br />
            <textarea onChange={onChange}
              defaultValue={value}
              className="description-input-field"
              rows="10"
              cols="50"
              placeholder="Journal Description"
            ></textarea>
          </div>
          <div>
            <button className="button-save-journal" >Save</button>
          </div>
        </div>
      </div>
      </form>
  
  );
};

export default NewJournalForm;
